public List topKFrequent(int[] nums, int k) {
    if (nums == null || nums.length == 0 || k  map = new HashMap<>();
    for (int i : nums) {
        map.put(i, map.getOrDefault(i, 0) + 1);
    }

    // boundary check again
    if (k > map.size()) return null;

    // create result list
    List res = new ArrayList<>();

    // create a priority queue(max heap)
    PriorityQueue> q = 
        new PriorityQueue<>(Map.Entry.comparingByValue().reversed()); // n - k
    for (Map.Entry e : map.entrySet()) {
        q.offer(e);
        if (q.size() > map.size() - k) // get elements excluded from max heap 
            res.add((int)q.poll().getKey());
    }
    return res;
}

