from collections import OrderedDict
class LRUCache:

    def __init__(self, capacity):
        """
        :type capacity: int
        """
        self.cap = capacity
        self.d = OrderedDict()


    def get(self, key):
        """
        :type key: int
        :rtype: int
        """
        if key in self.d:
            value = self.d.pop(key)
            self.d[key] = value
            return value
        return -1

    def put(self, key, value):
        """
        :type key: int
        :type value: int
        :rtype: void
        """
        if key in self.d:
            self.d.pop(key)
        else:
            if self.cap > 0:
                self.cap -= 1
                self.d[key] = value
            else:
                self.d.popitem(last=False)
        self.d[key] = value

