class Node:
    def __init__(self, key, value):
        self.key = key
        self.value = value
        self.prev = None
        self.next = None

class LRUCache(object):

    def __init__(self, capacity):
        """
        :type capacity: int
        """
        self.capacity = capacity
        self.d = {}
        self.head, self.tail = Node(0, 0), Node(0, 0)
        self.head.next = self.tail
        self.tail.prev = self.head

    def get(self, key):
        """
        :type key: int
        :rtype: int
        """
        if key in self.d:
            node = self.d[key]
            self._remove(node)
            self._add(node)
            return node.value
        return -1


    def put(self, key, value):
        """
        :type key: int
        :type value: int
        :rtype: void
        """
        new_node = Node(key, value)
        if key in self.d:
            node_remove = self.d[key]
            self._remove(node_remove)
        else:
            if self.capacity > 0:
                self.capacity -= 1
            else:
                node_remove = self.head.next # get the front node
                self._remove(node_remove)   # remove linked list
                del self.d[node_remove.key] # remove dict
        self._add(new_node)         # update linked list
        self.d[key] = new_node      # update dict


    def _add(self, node):
        last_node = self.tail.prev # get the last node
        last_node.next = node
        node.prev = last_node
        node.next = self.tail
        self.tail.prev = node

    def _remove(self, node):
        prev_node = node.prev
        next_node = node.next
        prev_node.next = next_node
        next_node.prev = prev_node


