public List> permuteUnique(int[] nums) {
    List> res = new ArrayList<>();
    List path = new ArrayList<>();
    boolean[] used = new boolean[nums.length];
    Arrays.sort(nums);
    dfs(nums, path, res, used);
    return res;
}

public void dfs(int[] nums, List path, List> res, boolean[] used) {
    if (path.size() == nums.length) {
        res.add(new ArrayList<>(path));
        return;
    }
    for (int i = 0; i  0 && nums[i] == nums[i - 1] && !used[i - 1]) continue;
        // if two nums are the same, and the previous one were not used, then do not use this num
        used[i] = true;
        path.add(nums[i]);
        dfs(nums, path, res, used);
        used[i] = false;
        path.remove(path.size() - 1);
    }
}

