import timeit

# O(1.618^n)
def fib(n):
    if n == 0:
        return 0
    if n == 1:
        return 1
    return fib(n - 1) + fib(n - 2)

# O(n)
def fib_mem(n):
    res = [-1 for i in range(n + 1)]
    def sfib(n):
        if n == 0:
            return 0
        if n == 1:
            return 1
        if res[n] == -1:
            res[n] = sfib(n - 1) + sfib(n - 2)
        return res[n]
    return sfib(n)

# O(n)
def fib_dp(n):
    res = [0 for i in range(n + 1)]
    res[1] = 1
    for i in range(2, n + 1):
        res[i] = res[i - 1] + res[i - 2]
    return res[n]

